import React from 'react';
import { Image, Container } from 'semantic-ui-react';

function ShaneGear() {
    return(
        <Container className="shane-about" textAlign="left">
            <Image src={require("../../../images/")} floated="left" size="small"/>

        </Container>
    )
}

export default ShaneGear;
